    title: "Uses Of Plaintain",
    content:
      '<p><span class="fbPhotosPhotoCaption" data-ft="{&quot;tn&quot;:&quot;K&quot;}" id="fbPhotoSnowliftCaption" tabindex="0" style="outline: 0px; transition: all 0.3s ease 0s; color: rgb(46, 46, 46); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;"><span class="hasCaption" style="outline: 0px; transition: all 0.3s ease 0s;"><i><br style="outline: 0px; transition: all 0.3s ease 0s;">Plantain are banana cultivars in the genus Musa whose fruit are generally used in cooking. They may be eaten while ripe or unripe and starchy. Some cooking bananas are also referred to as green banana or plantain.<br style="outline: 0px; transition: all 0.3s ease 0s;">There\'s no formal botanical distinction between bananas and plantains. Cooking is also a matter of custom, rather than necessity. Ripe plantain can be eaten raw, since the st</i><span class="text_exposed_show" style="outline: 0px; transition: all 0.3s ease 0s;"><i>arches are converted to sugar as they ripen.</i><br style="outline: 0px; transition: all 0.3s ease 0s;"><br style="outline: 0px; transition: all 0.3s ease 0s;"><b>Plantain are major staple in West and Central Africa</b>. They are treated as a starchy fruit with a relatively neutral flavor and soft texture when cooked. As with all bananas, part of the attractiveness of plantain as food is that they fruit all year round, making them a reliable all-season staple food. It contain more starch. Yellow plantain can be eaten raw, fried, they tend to caramelize turning a golden-brown color. They can also boiled, baked, microwaved or grilled over charcoal, either peeled or unpeeled.</span></span></span><br style="outline: 0px; transition: all 0.3s ease 0s; color: rgb(46, 46, 46); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;"></p><div class="_xlr" style="outline: 0px; transition: all 0.3s ease 0s; color: rgb(46, 46, 46); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;"><span class="fbPhotosPhotoCaption" data-ft="{&quot;tn&quot;:&quot;K&quot;}" id="fbPhotoSnowliftCaption" tabindex="0" style="outline: 0px; transition: all 0.3s ease 0s;">A ripe plantain is used as food for infants at weaning mashed with a pinch of salt.<br style="outline: 0px; transition: all 0.3s ease 0s;"><br style="outline: 0px; transition: all 0.3s ease 0s;">-Dried flour<br style="outline: 0px; transition: all 0.3s ease 0s;">They are dried and ground into flour, banana meal forms an important foodstuff<br style="outline: 0px; transition: all 0.3s ease 0s;"><span style="outline: 0px; transition: all 0.3s ease 0s;">with the following constituent :Water, 1062%, Protein 355%, Fat:115%,Carbohydrate:81</span><wbr style="outline: 0px; transition: all 0.3s ease 0s;"><span class="word_break" style="outline: 0px; transition: all 0.3s ease 0s;"></span>67% and ash 301%.<br style="outline: 0px; transition: all 0.3s ease 0s;">Dried plantain powder is used as baby food to feed babies until they are one year old.<br style="outline: 0px; transition: all 0.3s ease 0s;"><br style="outline: 0px; transition: all 0.3s ease 0s;">-Drink<br style="outline: 0px; transition: all 0.3s ease 0s;">Plantain are boiled and blended with water, spices and sugar to make a drink.<br style="outline: 0px; transition: all 0.3s ease 0s;"><br style="outline: 0px; transition: all 0.3s ease 0s;">-Chips<br style="outline: 0px; transition: all 0.3s ease 0s;">The unripe ones are sliced thin and deep fried in hot oil to produce chips.</span></div>',
