const validateEmail = async (email) => {
  //validate email function
  const re =
    /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
  //The above regex (regular expression, Faundamental Of Computer Scienece) validates to ensure that the email is in the correct format
  // https://stackoverflow.com/questions/46155/how-to-validate-an-email-address-in-javascript
  return re.test(String(email).toLowerCase());
};

function setLoader(state) {
  //This function determine if the loader should be shown or not
  const loaderDom = document.getElementById("loader");
  if (!loaderDom) return; //if the loader doesn't exist, stop the function from running in order to prevent errors
  if (state === true) {
    //if the state is true, show the loader
    loaderDom.style.display = "block"; //show the loader
  } else {
    loaderDom.style.display = "none"; //hide the loader
  }
}

function fileToBase64(file) {
  //This function converts a file to a base64 string
  //reference: https://stackoverflow.com/questions/12168909/blob-to-base64-encoded-string
  return new Promise((resolve, reject) => {
    const reader = new FileReader();
    reader.readAsDataURL(file);
    reader.onload = () => resolve(reader.result);
    reader.onerror = (error) => reject(error);
  });
}
async function signUp( // This function contains all the logic for signing up a user. It's asynchrnous because it uses the localforage library which returns promises
  firstName,
  lastName,
  avatar,
  email,
  securityQuestion,
  password
) {
  //sign up function
  try {
    //Set the loader to true, so that the loader will be shown and user will not be able to interact with the page
    setLoader(true);
    //According to the software design and development module This try block is used to catch any errors that may occur because of the user input and as a result of some asynchronous code
    //validate all fields again to ensure that they are in the correct form as expected
    if (
      firstName === "" ||
      lastName === "" ||
      avatar === "" ||
      email === "" ||
      password === ""
    ) {
      //if any of the fields are empty
      alert("Please fill in all fields");
      setLoader(false); //hide the loader

      return; //This will stop the function from running
    }
    if (password.length < 6) {
      //if the password is less than 6 characters
      alert("Password must be at least 6 characters");
      setLoader(false); //hide the loader

      return;
    }
    //check if email is valid
    if (!validateEmail(email)) {
      alert("Please enter a valid email address");
      setLoader(false); //hide the loader
      return;
    }

    //security Question must be an object with a question and answer property (see below)
    if (typeof securityQuestion !== "object") {
      alert("Please enter a valid security question");
      setLoader(false); //hide the loader
      return;
    }
    if (securityQuestion.question === "" || securityQuestion.answer === "") {
      alert("Please enter a valid security question");
      setLoader(false); //hide the loader

      return;
    }

    //This check if avatar not a File object
    if (!(avatar instanceof File)) {
      alert("Please upload a profile picture");
      setLoader(false); //hide the loader

      return;
    }

    //if avatar is a file object
    //initiate a variable that will hold the base64 encoded image
    let profilePic = await fileToBase64(avatar); //wait for the base64 string to be stored in the profilePic variable

    //check if email is already in use
    const user = await localforage.getItem(email);
    if (user) {
      alert("Email already in use");
      setLoader(false); //hide the loader
      return;
    }
    //if all fields are valid, create a new user
    const newUser = {
      firstName,
      lastName,
      avatar: profilePic,
      email,
      password,
      created: new Date(),
      securityQuestion,
    };
    //save new user to be saved to local storage
    await localforage.setItem(email, newUser);
    setLoader(false);
    //alert user that the user has been created
    alert("Account created, please sign in");
    //close the sign up modal
    signUpModal.hide();
    loginModal.show(); //show the login modal
  } catch (error) {
    setLoader(false);
    alert(error.message);
    alert("Kindly select a profile picture of size less than 2MB"); //Most likely the user has selected a file that is too large and cannot be converted to base64
  }
}

async function signIn(email, password) {
  //This function contains all the logic for signing in a user
  try {
    setLoader(true);
    //check if email is already in use
    const user = await localforage.getItem(email);
    if (!user) {
      alert("Sorry, we couldn't find an account with that email");
      setLoader(false); //hide the loader
      return;
    }
    //check if password is correct
    if (user.password !== password) {
      alert("Incorrect password");
      setLoader(false); //hide the loader
      return;
    }
    //save user to be save to local storage
    await localforage.setItem("user", user);
    setLoader(false); //hide
    alert("Welcome " + user.firstName + " " + user.lastName);
    //reload the page
    window.location.reload();
  } catch (error) {
    setLoader(false);
    alert(error.message);
  }
}

async function signOut() {
  //This function contains all the logic for signing out a user
  if (!confirm("Are you sure you want to sign out?")) return; //if the user cancels the sign out, stop the function from running
  try {
    //remove user from local storage
    await localforage.removeItem("user");
    //reload the page
    alert("You have been signed out");
    window.location.reload();
  } catch (error) {
    alert(error.message);
  }
}

async function resetUserPassword(email, newPassword, securityAnswer) {
  //This function contains all the logic for resetting a user's password
  try {
    setLoader(true);
    //check if email is already in use
    let user = await localforage.getItem(email);
    if (!user) {
      alert("Sorry, we couldn't find an account with that email");
      setLoader(false); //hide the loader
      return;
    }
    //check if security answer is correct
    if (user.securityQuestion.answer !== securityAnswer) {
      alert("Incorrect security answer");
      setLoader(false); //hide the loader
      return;
    }
    user.password = newPassword; //set the new password
    //save user to be save to local storage
    await localforage.setItem(email, user);
    setLoader(false); //hide
    alert("Password has been reset");
    forgotPasswordModal.hide(); //close the modal
  } catch (error) {
    setLoader(false);
    alert(error.message);
  }
}
async function CheckLoggedInUser() {
  //This function contains all the logic for checking if a user is logged in
  try {
    //get user from local forage
    const user = await localforage.getItem("user");
    const awaitedReviews = await localforage.getItem("reviews");
    const awaitedArticles = await localforage.getItem("articles");
    if (!awaitedReviews) {
      //if there are no reviews or it's null
      await localforage.setItem("reviews", reviews); //set the reviews to the default reviews
    } else {
      reviews = awaitedReviews; //set the reviews to the local storage reviews
    }
    if (!awaitedArticles) {
      //if there are no articles or it's null
      await localforage.setItem("articles", articles); //set the articles to the default articles
    } else {
      articles = awaitedArticles; //set the articles to the local storage articles
    }
    //set authors based on the registered users
    await localforage.iterate((value, key, index) => {
      const allAuthorsDetails = authors.map((author) => author.authorDetails);
      if (validateEmail(key)) {
        //if the key is an email
        if (value.authorDetails) {
          //if the user has an author details object
          if (!allAuthorsDetails.includes(value.authorDetails)) {
            //if the author details object is not in the list of all authors
            authors.push(
              value //add the author details to the authors array
            );
          }
        }
      }
    });

    await localforage.setItem("authors", authors);
    if (user) {
      //if user is found, redirect to home page
      // window.location.href = "home.html";
      return user;
    }
  } catch (error) {
    alert(error.message);
  }
}

