document.getElementById("signupForm").addEventListener("submit", (e) => {
  //This event listener is used to sign up a user
  e.preventDefault(); //This prevents the page from reloading
  //Firstly this will get alll input tags from the form
  const inputs = e.target.querySelectorAll("input");
  //Then i initiate this object to hold the input names and values as key value pairs
  const userInput = {};
  //Then i loop through all the inputs and add them to the userInput object
  for (const input of inputs) {
    if (input.type === "file") {
      //if the input is an avatar
      userInput[input.name] = input.files[0]; //set the value to the file that was uploaded
      //because the value is only a fake path (like C:\fakepath\filename.ext)  and not the actual file, we need to get the actual file
      continue; //continue to the next input
    }
    userInput[input.name] = input.value;
  }
  //Then i initiate a new object to hold the security question
  const securityQuestion = {};
  securityQuestion.question = userInput.question;
  securityQuestion.answer = userInput.answer;
  //Then i remove the security question from the userInput object
  delete userInput.question;
  delete userInput.answer;
  //Then i sign up the user
  signUp(
    userInput.firstName,
    userInput.lastName,
    userInput.avatar,
    userInput.email,
    securityQuestion,
    userInput.password
  );
});

